use std::collections::HashMap;

// 1 <= deliciousness.length <= 10^5
// 0 <= deliciousness[i] <= 2^20
pub fn count_pairs(deliciousness: Vec<i32>) -> i32 {
    let mut two_powers = Vec::new();
    for i in 0..22 {
        two_powers.push(2i32.pow(i));
    }

    let mut deliciousness_ordered:HashMap<String, i32>= HashMap::new();
    for &d in deliciousness.iter() {
        if let Some(o) = deliciousness_ordered.get_mut(&(d.to_string())) {
            *o += 1;
        } else {
            deliciousness_ordered.insert(d.to_string(), 1);
        }
    }

    let mut count = 0i32;
    for i in 0..deliciousness.len()-1 {
        // remove current i
        if let Some(d) = deliciousness_ordered.get_mut(&(deliciousness[i].to_string())) {
            *d -= 1;
            if *d <= 0 {
                deliciousness_ordered.remove(&(deliciousness[i].to_string()));
            }
        }
        for &power in two_powers.iter() {
            let left_part = power - deliciousness[i];
            if left_part < 0 {
                continue;
            }
            if let Some(&d) = deliciousness_ordered.get(&(left_part.to_string())) {
                count += d;
                count %= (10i32.pow(9) + 7);
            }
        }
    }

    count%(10i32.pow(9) + 7)
}

